
public class Vehicle {

	int horsePower;
	int price;
	String id;
	String vehicle;
	String name;
	String engine;
	String manufacturer;
	String type;
	String color;
	
	public Vehicle() {
		// TODO Auto-generated constructor stub
	}
	
	public Vehicle(String id, int horsePower, int price, String vehicle, String name, String engine, String manufacturer, String type, String color) {
		this.id = id;
		this.horsePower = horsePower;
		this.price = price;
		this.vehicle = vehicle;
		this.name = name;
		this.engine = engine;
		this.manufacturer = manufacturer;
		this.type = type;
		this.color = color;
	}

}
